import React, { Component } from 'react';
import {BootstrapTable, 
       TableHeaderColumn} from 'react-bootstrap-table';
import './Table.css';
// import './node_modules/react-bootstrap-table/css/react-bootstrap-table.css'

export default class Table1 extends Component {
  render() {
    return (
      <div>
        <BootstrapTable data={this.props.data}>
          <TableHeaderColumn isKey dataField='id' width='35px'>
            ID
          </TableHeaderColumn>
          <TableHeaderColumn dataField='name' width='35px'>
            Name
          </TableHeaderColumn>
          <TableHeaderColumn dataField='roll'>
            Roll
          </TableHeaderColumn>
          <TableHeaderColumn dataField='course'>
           Course
          </TableHeaderColumn>
          <TableHeaderColumn dataField='college'>
          College
          </TableHeaderColumn>
          <TableHeaderColumn dataField='branch'>
          Branch
          </TableHeaderColumn>
          <TableHeaderColumn dataField='address'>
          Address
          </TableHeaderColumn>
        </BootstrapTable>
      </div>
    );
  }
}
